    func testDet() throws {
        let matrix = Matrix<Double>(elements: [1,2,3,4], rows: 2, columns: 2)
        let det = matrix.det()
        XCTAssertEqual(det!, -2)

        let slogdet = matrix.slogdet()
        XCTAssertEqual(slogdet.sign, -1)
        XCTAssertEqual(slogdet.determinant, 0.69314718055994529, accuracy: 0.0000000000000001)
    }
    
