        }
    }
    
    func testStateRestoration() async throws {
        let audiograms = [
            [16.2, 17.9, 17.3, 11.7, 12.2, 36.2],
            [5.63, 7.66, 9.33, 7.54, 4.44, 14.7],
            [9.39, 13.0, 16.3, 16.7, 12.2, 18.7],
            [13.3, 15.6, 16.0, 8.72, 3.40, 12.8],
            [28.0, 30.1, 29.6, 17.9, 9.94,19.67],
            [18.8, 22.1, 25.2, 23.6, 18.0, 24.5],
            [36.3, 38.4, 37.4, 27.6, 20.5, 35.9],
            [19.6, 22.3, 22.6, 13.2, 6.15, 14.9],
            [25.8, 27.4, 25.8, 19.3, 24.3, 47.9],
            [23.4, 26.2, 29.2, 34.8, 43.2, 52.7],
            [12.3, 14.7, 16.9, 18.5, 30.6, 47.6],
            [43.6, 46.7, 49.1, 46.0, 37.9, 52.0],
            [75.0, 75.0, 90.0, 80.0, 75.0, 65.0],
        ]
        
        await runFullTestWith(audiograms, accuracy: 3, testStateRestoration: true)
    }

    func runFullTestWith(_ audiograms: [[Double]], accuracy: Double = 5, frequencies: [Double] = [250,500,1000,2000,4000,8000], testStateRestoration: Bool = false) async {
        for audiogram in audiograms {
            let maxLevel = 75.0
            let minLevel = -10.0
            let initialLevel = 60.0
            
            var newAudiometry = ORKNewAudiometry(channel: .left, initialLevel: initialLevel, minLevel: minLevel, maxLevel: maxLevel, frequencies: frequencies)
                        
            // interpolate between audiogram points
            let freqHL = newAudiometry.bark(frequencies.asVector())
            let combinedAudiogram = zip(freqHL.elements, audiogram).map { ($0, $1) }
            let sortedAudiogram = combinedAudiogram.sorted { $0.0 < $1.0 }
            let cs = CubicSpline(xp: sortedAudiogram.map { $0.0 }, fp: sortedAudiogram.map { $0.1 })

            while newAudiometry.testEnded == false {
                if (testStateRestoration) {
                    let state = newAudiometry.state
                    newAudiometry = ORKNewAudiometry(channel: .left, initialLevel: initialLevel, minLevel: minLevel, maxLevel: maxLevel, frequencies: frequencies)
                    newAudiometry.state = state
                }
                
                let status = await withCheckedContinuation({ continuation in
                    newAudiometry.nextStatus { continuation.resume(returning: ($0, $1)) }
                })
                if let stimulus = status.1 {
                    let freqPoint = newAudiometry.bark(stimulus.frequency)
                    let testLevel = cs.f(forX: freqPoint)
                    
                    newAudiometry.registerStimulusPlayback()
                    if stimulus.level > testLevel {
                        newAudiometry.registerResponse(true)
                    } else {
                        newAudiometry.registerResponse(false)
                    }
                }
            }
            
            let res = newAudiometry.resultSamples()
            let filteredRes = frequencies.compactMap { freq in
                res.first { $0.frequency == freq }
            }
            
//            Debug logs
            let onLimits = audiogram.allSatisfy { $0 <= maxLevel && $0 >= minLevel }
            print("\nFinished with \(newAudiometry.ySample.shape.rows) trials")
            print("Freqs:  \(filteredRes.map { String(fromFrequency: $0.frequency) })")
            print("Input:  \(audiogram.map { String(fromThreshold: $0) } ) \(onLimits ? "" : "Contains thresholds out of limits")")
            print("Output: \(filteredRes.map { String(fromThreshold: $0.calculatedThreshold) }) \(onLimits ? "" : "Results clipped to limits")")

            let deltas = zip(audiogram, filteredRes.map { $0.calculatedThreshold }).map { $1 - $0 }
            let maxMag = String(format: "%.4lf", deltas.map { abs($0) }.max() ?? 0.0)
            let avgMag = String(format: "%.4lf", deltas.map { abs($0) }.reduce(0, +) / Double(deltas.count))
            print("Deltas: \(deltas.map { String(fromThreshold: $0) }) Max: \(maxMag)  Avg: \(avgMag)")
            
            if (newAudiometry.initialSampleEnded && newAudiometry.testEnded) {
                XCTAssertGreaterThanOrEqual(newAudiometry.progress, 1.0)
            }
            
            XCTAssertGreaterThanOrEqual(newAudiometry.progress, 1.0)
            
            // Check the results of a valid test
            XCTAssertEqual(filteredRes.count, audiogram.count)
            for (value1, value2) in zip(filteredRes, audiogram) {
                var clippedValue2 = min(maxLevel, value2)
                clippedValue2 = max(minLevel, clippedValue2)
                
                XCTAssertEqual(value1.calculatedThreshold, clippedValue2, accuracy: accuracy, "calculatedThreshold does not match expected level for frequency: \(value1.frequency) With error: \(value1.calculatedThreshold - clippedValue2)\n Expected: \(audiogram.map { String(format: "%.2f", $0) })\n Result:   \(res.map { String(format: "%.2f", $0.calculatedThreshold) })\n")
            }
        }
    }
}

// These are direct ports of original Python implementation1 used as reference to the iteractive test results
@available(iOS 14, *)
extension ORKNewAudiometry {
    func initialSample(_ idx: Int) -> (xSample: Matrix<Double>, ySample: Matrix<Double>, xTrue: Vector<Double>, yTrue: Vector<Double>) {
        let freqHL = bark([250, 500, 1000, 2000, 4000, 8000])
        let audiograms = Matrix(elements: [16.2, 17.9, 17.3, 11.7, 12.2, 36.2,
                                           5.63, 7.66, 9.33, 7.54, 4.44, 14.7,
                                           9.39, 13.0, 16.3, 16.7, 12.2, 18.7,
                                           13.3, 15.6, 16.0, 8.72, 3.40, 12.8,
                                           28.0, 30.1, 29.6, 17.9, 9.94, 19.67,
                                           18.8, 22.1, 25.2, 23.6, 18.0, 24.5,
                                           36.3, 38.4, 37.4, 27.6, 20.5, 35.9,
                                           19.6, 22.3, 22.6, 13.2, 6.15, 14.9,
                                           25.8, 27.4, 25.8, 19.3, 24.3, 47.9,
                                           23.4, 26.2, 29.2, 34.8, 43.2, 52.7,
                                           12.3, 14.7, 16.9, 18.5, 30.6, 47.6,
                                           43.6, 46.7, 49.1, 46.0, 37.9, 52.0], rows: 12, columns: 6)
        
        let dBHL = audiograms.getRow(idx)

        // interpolate between audiogram points
        let xTrue = vDSP.linearInterpolate(values: [freqHL.minimum(),freqHL.maximum()], atIndices: [0,999])
        let yTrue = Interpolators.interp(indices: xTrue, xValues: freqHL.elements, yValues: dBHL.elements)
        
        // initialization based on Schlittenlacher et al 2018
        let testFs = bark([1000, 2000, 4000, 8000, 500, 250])
        let revFs = bark([1000, 8000, 250]) // frequencies that need reversals

        // first tone
        var freqPoint = bark(1000)
        var dbHLPoint = 45.0
        
        let jumpF = bark(500)
        var dbHLPoint1k = dbHLPoint
        var ySample1k = 0.0

        var xSample = Matrix(elements: [freqPoint,dbHLPoint], rows: 1, columns: 2)
        var responseAmplitude = yTrue[findNearest(xTrue.asVector(), freqPoint)]
        var ySample = Matrix<Double>(elements: [], rows: 0, columns: 1)
        if dbHLPoint > responseAmplitude {
            ySample.appendRow([1])
        } else {
            ySample.appendRow([0])
        }
        
        // rest tones
        for freq in testFs {
            freqPoint = freq
            
            // save data at 1kHz to for continuity
            if (freqPoint == testFs[1]) && (xSample[xSample.shape.rows - 1, 0] == testFs[0]) {
                dbHLPoint1k = dbHLPoint
                ySample1k = ySample.elements[ySample.elements.count - 1]
            }

            if revFs.contains(freqPoint) { // reversals needed
                var negResp = 0
                var posResp = 0
                
                if xSample[xSample.shape.rows - 1, 0] == freqPoint { // last sample is at same frequency
                    if ySample.elements.last == 0 {
                        negResp = 1
                    } else {
                        posResp = 1
                    }
                }
                
                while negResp == 0 || posResp == 0 {
                    if (freqPoint == jumpF) && (xSample[xSample.shape.rows - 1, 0] != freqPoint) { // use 1k data as reference
                        if ySample1k == 0 { // last 1k response is negative
                            dbHLPoint = min(dbHLPoint1k + 10, 75)
                        } else { // last 1k response is positive
                            dbHLPoint = max(dbHLPoint1k - 10, -10)
                        }
                    } else {
                        if ySample.elements.last == 0 { // last response is negative
                            dbHLPoint = min(dbHLPoint + 10, 75)
                        } else { // last response is positive
                            dbHLPoint = max(dbHLPoint - 10, -10)
                        }
                    }
                    
                    let xNext = Matrix(elements: [freqPoint, dbHLPoint], rows: 1, columns: 2)
                    responseAmplitude = yTrue[findNearest(xTrue.asVector(), freqPoint)]
                    
                    let yNext: Double
                    if dbHLPoint > responseAmplitude {
                        yNext = 1
                    } else {
                        yNext = 0
                    }
                    
                    xSample.appendRow(xNext.transposed().elements)
                    ySample.appendRow([yNext])
                    
                    if yNext == 1.0 {
                        posResp = 1
                        if dbHLPoint == -10 {
                            break
                        }
                    } else {
                        negResp = 1
                        if dbHLPoint == 75 {
                            break
                        }
                    }
                }
            } else { // only one response needed
                if freqPoint == jumpF { // use 1k data as reference
                    if ySample1k == 0 { // last 1k response is negative
                        dbHLPoint = min(dbHLPoint1k + 10, 75)
                    } else { // last 1k response is positive
                        dbHLPoint = max(dbHLPoint1k - 10, -10)
                    }
                } else {
                    if ySample.elements.last == 0 { // last response is negative
                        dbHLPoint = min(dbHLPoint + 10, 75)
                    } else { // last response is positive
                        dbHLPoint = max(dbHLPoint - 10, -10)
                    }
                }
                
                let xNext = Matrix(elements: [freqPoint, dbHLPoint], rows: 1, columns: 2)
                responseAmplitude = yTrue[findNearest(xTrue.asVector(), freqPoint)]
                
                let yNext: Double
                if dbHLPoint > responseAmplitude {
                    yNext = 1.0
                } else {
                    yNext = 0.0
                }

                xSample.appendRow(xNext.transposed().elements)
                ySample.appendRow([yNext])
            }
        }

        return (xSample, ySample, xTrue.asVector(), yTrue.asVector())
    }
}

extension Interpolators {
    @inlinable public static func interpCs(x: [Double], xp: [Double], fp: [Double]) -> [Double] {
        guard x.count > 0 else { return [] }
        precondition(xp.count == fp.count)

        let size = xp.count - 1
        let h = xp.dropLast().enumerated().map { xp[$0 + 1] - $1 } + [0.0]
        let t = [0.0] + Array(1..<size).map { 2.0 * Double(xp[$0 + 1] - xp[$0 - 1]) }
        let a = [0.0] + Array(1..<size).map { (i: Int) -> Double in
            (3 / h[i] * (fp[i + 1] - fp[i])) - (3 / h[i - 1] * (fp[i] - fp[i - 1]))
        }

        var l = Array(repeating: 1.0, count: xp.count)
        var z = Array(repeating: 0.0, count: xp.count)
        var u = Array(repeating: 0.0, count: xp.count)
        for (i, v) in t.enumerated() {
            guard let j = Int(exactly: i - 1), j >= 0 else { continue }
            l[i] = v - (u[j] * h[j])
            z[i] = (a[i] - (h[j] * z[j])) / l[i]
            u[i] = h[i] / l[i]
        }
        
        var b = Array(repeating: 0.0, count: xp.count)
        var c = Array(repeating: 0.0, count: xp.count)
        var d = Array(repeating: 0.0, count: xp.count)
        for i in (0...(size - 1)).reversed() {
            let j = i + 1
            let delta = fp[j] - fp[i]
            c[i] = z[i] - (u[i] * c[j])
            b[i] = (delta / h[i]) - h[i] * (c[j] + c[i] * 2) / 3
            d[i] = (c[j] - c[i]) / (h[i] * 3)
        }
        
        let result = x.map { (xPoint: Double) -> Double in
            let i = xp.partitioningIndex { $0 >= xPoint }
            let index = max(i - 1, 0)
            let delta = xPoint - xp[index]
            let delta1 = b[index] * delta
            let delta2 = c[index] * pow(delta, 2)
            let delta3 = d[index] * pow(delta, 3)
            return fp[index] + delta1 + delta2 + delta3
        }
        return result
    }
}

extension String {
    init(fromThreshold: Double) {
        self.init(stringLiteral: String(format: "%.2lf", fromThreshold).reversePadded(toLength: 6))
    }
    
    init(fromFrequency: Double) {
        self.init(stringLiteral: String(format: "%.0lf", fromFrequency).reversePadded(toLength: 6))
    }
    
    func reversePadded(toLength: Int) -> String {
        return String(String(self.reversed()).padding(toLength: toLength, withPad: " ", startingAt: 0).reversed())
    }
}

struct CubicSpline {
    let xp: [Double]
    let fp: [Double]
    
    let b: [Double]
    let c: [Double]
    let d: [Double]
    
    init(xp: [Double], fp: [Double]) {
        precondition(xp.count == fp.count)
        self.xp = xp
        self.fp = fp

        let size = xp.count - 1
        let h = xp.dropLast().enumerated().map { xp[$0 + 1] - $1 } + [0.0]
        let t = [0.0] + Array(1..<size).map { 2.0 * Double(xp[$0 + 1] - xp[$0 - 1]) }
        let a = [0.0] + Array(1..<size).map { (i: Int) -> Double in
            (3 / h[i] * (fp[i + 1] - fp[i])) - (3 / h[i - 1] * (fp[i] - fp[i - 1]))
        }

        var l = Array(repeating: 1.0, count: xp.count)
        var z = Array(repeating: 0.0, count: xp.count)
        var u = Array(repeating: 0.0, count: xp.count)
        for (i, v) in t.enumerated() {
            guard let j = Int(exactly: i - 1), j >= 0 else { continue }
            l[i] = v - (u[j] * h[j])
            z[i] = (a[i] - (h[j] * z[j])) / l[i]
            u[i] = h[i] / l[i]
        }
        
        var b = Array(repeating: 0.0, count: xp.count)
        var c = Array(repeating: 0.0, count: xp.count)
        var d = Array(repeating: 0.0, count: xp.count)
        for i in (0...(size - 1)).reversed() {
            let j = i + 1
            let delta = fp[j] - fp[i]
            c[i] = z[i] - (u[i] * c[j])
            b[i] = (delta / h[i]) - h[i] * (c[j] + c[i] * 2) / 3
            d[i] = (c[j] - c[i]) / (h[i] * 3)
        }
        
        self.b = b
        self.c = c
        self.d = d
    }
    
    func f(forX xPoint: Double) -> Double {
        let i = xp.partitioningIndex { $0 >= xPoint }
        let index = max(i - 1, 0)
        let delta = xPoint - xp[index]
        let delta1 = b[index] * delta
        let delta2 = c[index] * pow(delta, 2)
        let delta3 = d[index] * pow(delta, 3)
        
        return fp[index] + delta1 + delta2 + delta3
    }
}
